import React from 'react';
import TitleList from "./TitleList";

function Home() {
  return (
    <main>
      <p>
        Welcome to <b>Microblog</b>, our innovative site for communicating
        on the information superhighway.
      </p>
      <TitleList />
    </main>
  );
}

export default Home;
